import React from 'react'

const PhoneDetails = ({ phoneDetails }) => {
    return (
    <div>
        <center><h1>Number Info</h1></center>
        {phoneDetails.map((phoneDetail) => (
        <div class="card">
            <div class="card-body">
            <h5 class="card-title">{phoneDetail.number}</h5>
            <h6 class="card-subtitle mb-2 text-muted">{phoneDetail.local_format}</h6>
            <p class="card-text">{phoneDetail.country_prefix}</p>
            </div>
        </div>
        ))}
    </div>
    )
};

export default PhoneDetails
